import React from 'react';

function SidebarItem(props) {
  return (
    <li className="left-menu__item">
      <a className="left-menu__link" href={props.item.link}>{props.item.text}</a>
        <ul className="left-menu__second-list">
        
        {props.childs.map(child => {
          return(
            <li className="left-menu__second-list-item">
              <a className="left-menu__second-list-link" href={child.link}>{child.text}</a>
            </li>
          );
        })}
      </ul>
    </li>
  );
}

export default SidebarItem;
